import React from "react";

const cardClub = (props) => {
  const subjetsClub = props.subjects.map((item, index) => {
    return <li key={index}> {item}</li>;
  });
  return (
    <ul>
      <img src={props.fa} alt="img-icon-club" />
      <h2> {props.name}</h2>
      {subjetsClub}
    </ul>
  );
};

export default cardClub;
